import React from 'react';
import { Link } from 'react-router-dom';
import AboutMe from '../Components/AboutMe';

const InitialPage = () => {
    return (
        <div>
            <h1>Hello of InitialPage!</h1>
            <Link to='/about'>
                <AboutMe />
            </Link>
        </div>
    )
}

export default InitialPage;
